                  continues to be daring. Daring is knowing greatness doesn't
                  come from sameness. The past years have been characterized by
                  a transformation from traditional sports to fitness. The three
                  sides of the Reebok delta, a symbol of change and
                  transformation, represent the physical, mental and social
                  changes that occur when individuals embrace the challenge of
